import React from 'react'
import '../../App.css';
import data from './TouchableInstallerPage.json';
import TouchableInstallerContainer from './ProductInstallNavbar';

export default class ProductInstallPage extends React.Component {

    constructor(props) {
        super(props);
        this.state = { page_id: props.page_id, submenu_id: props.submenu_id, data: data };
    }

    render() {

        let page_id = this.state.page_id;
        const data = this.state.data;

        const products = data.products;
        var product;

        var add_id = "";
        for (var i = 0; i < products.length; ++i) {
            var product_i = products[i];
            if (product_i.app_id == page_id) {
                product = product_i;
                break;
            }
        }

        if (!product) {
            return (
                <ul class="navbar-nav w-100 justify-content-start">
                    <li class="nav-item active">
                        <a class="nav-link" href="https://www.zerodebug.com">no page found</a>
                    </li>
                </ul>
            );
        }



        let main_content = (
            <div>
            </div>
        )


        let desc_container = product.desc_container.map((store_item, i) => {
            return (
                <ProductInstallNavbar product_number={i} page_id={this.state.page_id} submenu_id={this.state.submenu_id} store_item={store_item} main_content={main_content} />
            );
        });


        return (


            <div>
            <div>
            {desc_container}
            </div>
            </div>

        );


    }
}
